import React, { useState } from 'react';

// Sample student data organized by academic year
const studentData = {
  '2023-24': [
    { id: 'S001', name: 'Rahul Kumar', dob: '2005-03-15', bloodType: 'O+', dateOfJoining: '2023-08-01', parentName: 'Raj Kumar', email: 'rahul.kumar@school.com', phone: '9876543210' },
    { id: 'S002', name: 'Priya Singh', dob: '2005-06-22', bloodType: 'A+', dateOfJoining: '2023-08-01', parentName: 'Vikram Singh', email: 'priya.singh@school.com', phone: '9876543211' },
    { id: 'S003', name: 'Arjun Patel', dob: '2005-01-10', bloodType: 'B+', dateOfJoining: '2023-08-01', parentName: 'Amit Patel', email: 'arjun.patel@school.com', phone: '9876543212' },
  ],
  '2024-25': [
    { id: 'S004', name: 'Ananya Sharma', dob: '2006-02-14', bloodType: 'AB+', dateOfJoining: '2024-08-01', parentName: 'Rohit Sharma', email: 'ananya.sharma@school.com', phone: '9876543213' },
    { id: 'S005', name: 'Vikram Reddy', dob: '2006-05-08', bloodType: 'O-', dateOfJoining: '2024-08-01', parentName: 'Suresh Reddy', email: 'vikram.reddy@school.com', phone: '9876543214' },
  ],
  '2025-26': [
    { id: 'S006', name: 'Neha Gupta', dob: '2007-07-20', bloodType: 'A-', dateOfJoining: '2025-08-01', parentName: 'Sanjay Gupta', email: 'neha.gupta@school.com', phone: '9876543215' },
    { id: 'S007', name: 'Aditya Verma', dob: '2007-04-12', bloodType: 'B-', dateOfJoining: '2025-08-01', parentName: 'Manoj Verma', email: 'aditya.verma@school.com', phone: '9876543216' },
    { id: 'S008', name: 'Riya Joshi', dob: '2007-09-05', bloodType: 'O+', dateOfJoining: '2025-08-01', parentName: 'Rajesh Joshi', email: 'riya.joshi@school.com', phone: '9876543217' },
  ],
  '2026-27': [
    { id: 'S009', name: 'Karan Singh', dob: '2008-11-18', bloodType: 'AB-', dateOfJoining: '2026-08-01', parentName: 'Harish Singh', email: 'karan.singh@school.com', phone: '9876543218' },
  ]
};

export default function Landing({ username, onLogout }) {
  const years = ['2023-2024', '2024-2025', '2025-2026', '2026-2027'];
  const [selected, setSelected] = useState(years[0]);

  const students = studentData[selected] || [];

  return (
    <div className="landing-container">
      <div className="header-card">
        <h2>Welcome {username}</h2>
        <div className="field">
          <label>Select Academic Year</label>
          <select value={selected} onChange={(e) => setSelected(e.target.value)}>
            {years.map((y) => (
              <option key={y} value={y}>{y}</option>
            ))}
          </select>
        </div>
        <button className="logout-btn" onClick={onLogout}>Logout</button>
      </div>

      <div className="table-container">
        <h3>Students - Academic Year {selected} ({students.length} students)</h3>
        {students.length > 0 ? (
          <table className="students-table">
            <thead>
              <tr>
                <th>Roll Number</th>
                <th>Name</th>
                <th>Date of Birth</th>
                <th>Blood Type</th>
                <th>Date of Joining</th>
                <th>Parent Name</th>
                <th>Email</th>
                <th>Phone</th>
              </tr>
            </thead>
            <tbody>
              {students.map((student) => (
                <tr key={student.id}>
                  <td>{student.id}</td>
                  <td>{student.name}</td>
                  <td>{student.dob}</td>
                  <td>{student.bloodType}</td>
                  <td>{student.dateOfJoining}</td>
                  <td>{student.parentName}</td>
                  <td>{student.email}</td>
                  <td>{student.phone}</td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>No students found for this academic year.</p>
        )}
      </div>
    </div>
  );
}
